import React, { useEffect } from "react";
import Header from "./Header";
import axios from "axios";

const Three = () => {
  const apiUrl = `/recent`;
  // 이미지 받기
  const ImagetoMe = async () => {
    try {
      const { data } = await axios.get(`${apiUrl}`);
      console.log(data.data.original[0]);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    ImagetoMe();
  }, []);

  return (
    <>
      <Header title={"사진 선택"} />
    </>
  );
};

export default Three;
